> It would also be good to clarify whether we want tiers of support in order to provide the best experience in each product or shoot for a lowest common denominator that works equally well in all but sub-optimally in some.

@pq do you have a concrete example of what kind of issue we might get?

I have just a basic understanding of IntelliJ plugins, but from poking around [the dev docs](It would also be good to clarify whether we want tiers of support in order to provide the best experience in each product or shoot for a lowest common denominator that works equally well in all but sub-optimally in some.), it looks all editions are API compatible, it's just that some Java specific APIs are missing in CE.
